import { confirmAlert } from 'react-confirm-alert'; // Import
import 'react-confirm-alert/src/react-confirm-alert.css'; // Import css
import { useEffect, useState } from 'react';
import SellingCard from './SellingCard';


function HomePageCard(){

  //screen determines which type of home page screen will be shown
  const[screen, setScreen]=useState();

    const submit = () => {
        confirmAlert({
          title: 'Dobrodošli!',
          message: 'Molimo Vas izaberite da li želite da kupite ili prodate nekretninu.',
          buttons: [
            {
              label: 'Kupujem',
              onClick: () => {
                setScreen(0);
              }
            },
            {
              label: 'Prodajem',
              onClick: () => {
                setScreen(1);
              }            
            }
          ]
        });
    };



    useEffect(()=>{
        submit();
    },[])

    return(
      <div>
      {screen===1 ?
        <div className='background'>
          <SellingCard/>
        </div> : 
        <div>
          <iframe title="proba" width="1140" height="541.25" src="https://app.powerbi.com/reportEmbed?reportId=25c1f911-75bd-4fc3-a42b-9a08d4d806ad&autoAuth=true&ctid=4bd7928d-756a-4396-8d8f-803e40dd52db" frameborder="0" allowFullScreen="true"></iframe>
          </div>
      }
      </div>
    )
}
export default HomePageCard;
